List<Process> processes = new List<Process>();\n\ntry\n{\n    foreach (string command in S) // command is something like "c:\\a.exe"\n    {\n        Process process = Process.Start(command);\n        processes.Add(process);\n    }\n\n    // Optionally wait for all processes to exit\n    foreach (Process process in processes)\n    {\n        process.WaitForExit();\n    }\n}\ncatch (Exception e)\n{\n    // Notify of process failure\n    Console.WriteLine($"Process failed: {e.Message}");\n}\nfinally\n{\n    // Ensure all processes are disposed\n    foreach (Process process in processes)\n    {\n        process?.Dispose();\n    }\n}